import React from 'react';

const Law = ({contacts}) => {
    return (
        <div>
            <center><h1>Hullu lista</h1></center>
            {contacts.map((contact) => (
                <div class="card">
                    <div class="card-body">
                        <p class="card-text">{contact.languageVersion.hasFormat.content_fi}</p>
                    </div>
                </div>
            ))}
        </div>
    )
};

export default Law;
